import React from "react";
import RenderContentImg from "./RenderContentImg";





//==================

const MoviesList = (props) => {
  console.log(props)
  cons

  return (
   
    <React.Fragment>
      <h5>{props.title}</h5>
      <div className="contentFourth contentAll">
        {props.data.map((data) => {
          return (
            <RenderContentImg
              key={data.id}
              id={data.id}
              imgPbackdrop={`${dataAPI.HttpImg}${data.backdrop_path}`}
              name={data.title ? data.title : data.name}
              releaseDate={data.release_date}
              depcription={data.overview}
              vote={data.vote_average}
            />
          );
        })}
      </div>
    </React.Fragment>
  );
};
export default MoviesList;
